import React from 'react';

export default function Social() {
    return (
        <div className="home_social">

            <a href="https://github.com/RichardJeanBaptiste/RichardJeanBaptiste.github.io" className="home_social-icon" target="_blank">
                <i class="uil uil-github-alt"></i>
            </a>
        </div>
    )
}
